// ==UserScript==
// @name         Tiger and Dragon ADO Teams
// @namespace    http://manuelseeger.de
// @version      0.1
// @description  Show tiger and dragon icons
// @author       Manuel Seeger
// @match        https://dev.azure.com/swisslife/CTRM/_workitems/edit/*
// @icon         https://www.google.com/s2/favicons?domain=azure.com
// @grant        none
// @require      https://gist.githubusercontent.com/BrockA/2625891/raw/9c97aa67ff9c5d56be34a55ad6c18a314e5eb548/waitForKeyElements.js
// ==/UserScript==

(function() {
    'use strict';

    const main = (elems) => {
        if ($('TigerOrDragon').length) {
            return;
        }
        const area = elems[0].value;
        console.log(area);
        let imageData, url;
        let img = document.createElement('img');
        if (area.includes('Dragon')) {
            imageData = 'data:image/png;base64,';
            img.style.height = '70px';
            img.style.marginLeft = '-80px';
            img.style.marginTop = '-42px';
            url = 'https://dev.azure.com/swisslife/CTRM/_boards/board/t/E2E-Cockpit-Dragon/Backlog%20items';
        } else if (area.includes('Tiger')) {
            imageData = 'data:image/png;base64,';
            img = document.createElement('img');
            img.style.height = '80px';
            img.style.marginLeft = '-90px';
            img.style.marginTop = '-42px';
            url = 'https://dev.azure.com/swisslife/CTRM/_boards/board/t/E2E-Cockpit-Tiger/Backlog%20items';
        }

        img.style.position = 'absolute';
        img.src = imageData;
        img.id = 'TigerOrDragon';
        img.onclick = () => { document.location.href = url };
        img.style.cursor = 'pointer';


        $('[class="work-item-form-toolbar-container"]')[0].appendChild(img);
    }
    waitForKeyElements('input[aria-label="Area Path"]', main);
})();